import logo from './Nielsenlogo.jpg';
import React,{useState} from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import './App.css';
import ScrollableList from './ScrollableList';


const VAULT_TOKEN = "s.ukPYVYDjAmyYqSNPVbj6CCbR"
function HomeScreen() {
  const [token,setToken] = useState("George")
  const [error,setError] = useState("Initialized")

  function handleSubmit(event){
    // alert("hi")
    event.preventDefault();

    setToken(event.target.value)
    fetch(`policies?VAULT_TOKEN=`+event.target.value)
    .then(response => response.json())
    .then(data => {
        console.log("data" + data)
        setError(typeof data === 'object')
    })
  }
  return (
      <div className="App">
        <p style={{fontSize:50,color:"black",textAlign:"left",fontWeight:500}}>Policy Editor</p>
        <ScrollableList/>
      </div>
  );
}

export default HomeScreen;
